import React from 'react';
import './header2.css';
import { useNavigate } from 'react-router';
function Header2() {
    const name = "Alice";
    const navigate = useNavigate();
  return (
    <header>
      <nav>
      <ul>
          <li onClick={()=>{navigate("/")}}><a className="big-title">BERKERLEY APARTMENTS</a></li>
        </ul>
        <ul>
          <div onClick={()=>{navigate("/studentProfile")}} style={{marginRight:'100px'}}>Welcome, {name}</div>
          {/* <li><a href="#" className='avator'></a></li> */}
        </ul>
      </nav>
    </header>
  );
}

export default Header2;
